#define NEGHTBOR 8
/**/
uchar regionalmaxima(Mat im, Point p)
{
	uchar maxima = im.at<uchar>(p.y, p.x);
	for (int i = 0; i < NEGHTBOR; i++)
	{
		int x = p.x + x_offset[i];
		int y = p.y + y_offset[i];
		if (x > im.cols - 1) x = im.cols - 1;
		if (x < 0)         x = 0;
		if (y > im.rows - 1) y = im.rows - 1;
		if (y < 0)         y = 0;
		if (im.at<uchar>(y, x) > maxima)
			maxima = im.at<uchar>(y, x);
	}
	return maxima;

}
int IPA_getNearCutLineLen_Hori(unsigned char* ucBinImg, int nImgW, int x, int y, int nL, int nR)
{
	unsigned char *puc0, *puc;
	puc0 = ucBinImg + nImgW * y + x;
	if (*puc0)
	{
		puc = puc0;
		int nStart = nL;
		for (int i = x - 1; i >= nL; i--)
		{
			puc--;
			if (puc[0] == 0)
			{
				nStart = i;
				break;
			}
		}

		puc = puc0;
		int nEnd = nR;
		for (int i = x + 1; i <= nR; i++)
		{
			puc++;
			if (puc[0] == 0)
			{
				nEnd = i;
				break;
			}

		}

		return nEnd - nStart + 1;
	}
	return INT_MAX;
}

int IPA_getNearCutLineLen_Veti(unsigned char* ucBinImg, int nImgW, int x, int y, int nT, int nB)
{
	unsigned char *puc0, *puc;
	puc0 = ucBinImg + nImgW * y + x;
	if (*puc0)
	{
		puc = puc0;
		int nStart = nT;
		for (int j = y - 1; j >= nT; j--)
		{
			puc -= nImgW;
			if (puc[0] == 0)
			{
				nStart = j;
				break;
			}
		}

		puc = puc0;
		int nEnd = nB;
		for (int j = y + 1; j <= nB; j++)
		{
			puc += nImgW;
			if (puc[0] == 0)
			{
				nEnd = j;
				break;
			}

		}

		return nEnd - nStart + 1;
	}
	return INT_MAX;
}
void CalNearsTmpTable(int nImgW, int nBide, int *nNearsOffset)
{
	int nOffset = -nBide * nImgW;
	int k = 0;
	for (int j = -nBide; j < 0; j++)
	{
		for (int i = -nBide; i <= nBide; i++)
		{
			nNearsOffset[k++] = nOffset + i;
		}
		nOffset += nImgW;
	}

	for (int i = -nBide; i < 0; i++)
		nNearsOffset[k++] = nOffset + i;
	for (int i = 1; i <= nBide; i++)
		nNearsOffset[k++] = nOffset + i;
	nOffset += nImgW;

	for (int j = 1; j <= nBide; j++)
	{
		for (int i = -nBide; i <= nBide; i++)
		{
			nNearsOffset[k++] = nOffset + i;
		}
		nOffset += nImgW;
	}
}
bool pointsort(Point a, Point b) {
	return b.x < a.x;
}
bool renew_pointsort(Point a, Point b) {

	if (fabs(a.x - b.x) < FLT_MIN) {
		if (a.y < b.y) {
			return b.x > a.x;
		}
	}
	else 
		return b.x < a.x;

	/*if (fabs(p1.fVal1 - p2.fVal1) < FLT_MIN)
	{
		return p1.fVal2 > p2.fVal2;
	}
	else
		return p1.fVal1 > p2.fVal1;*/
}
bool Yrenew_pointsort(Point a, Point b) {

	if (fabs(a.y - b.y) < FLT_MIN) {
		if (a.x < b.x) {
			return b.y > a.y;
		}
	}
	else
		return b.y < a.y;
}
