/**/
bool isexistNBzero(Mat im, Point p)
{
	for (int i = 0; i < NEGHTBOR; i++)
	{
		int x = p.x + x_offset[i];
		int y = p.y + y_offset[i];
		if (x > im.cols - 1) x = im.cols - 1;
		if (x < 0)       x = 0;
		if (y > im.rows - 1) x = im.rows - 1;
		if (y < 0)       y = 0;
		if (im.at<uchar>(y, x) == 0)
			return true;
	}
	return false;
}
void IPA_memsetFImg_Rect(float *fImg, int nImgW, int nLeft, int nRight, int nTop, int nBottom) {
	float *pf;
	int nDifSize = (nRight - nLeft + 1)*(sizeof(float));

	pf = fImg + nTop * nImgW + nLeft;
	for (int y = nTop; y <= nBottom; y++)
	{
		memset(pf, 0, nDifSize);
		pf += nImgW;
	}
}
void IPA_findLocalMax(float *fGrayImg, int nImgW, int nLeft,  int nRight,int nTop, int nBottom, Mat maskMat, int nXShift, int nYShift, int nBlockSize, vector<Point> &ptVec)
{
	unsigned char *pucMask;
	float *pF, fM;
	bool bMax;
	int nOffset, nBide, nOffsets[6560];
	nBide = nBlockSize >> 1;
	//if (nBlockSize <= 1 || nBlockSize > 40 || (nBlockSize & 1 == 0))//IPA_findLocalMax_SameOnlyOne
	//{
	//	return;
	//}
	if (nBlockSize <= 1 || nBlockSize > 81 || (nBlockSize & 1 == 0) || nLeft - nBide < 0 || nRight + nBide >= nImgW || nTop - nBide < 0)//IPA_findLocalMax_SameOnlyOne
	{
		return;
	}

	int k = 0;
	nOffset = -nBide * nImgW;
	for (int j = -nBide; j <= nBide; j++)
	{
		for (int i = -nBide; i <= nBide; i++)
		{
			nOffsets[k++] = nOffset + i;

		}
		nOffset += nImgW;
	}
	nOffsets[k >> 1] = nOffsets[k - 1];



	int nMaskMatW = maskMat.cols;
	pF = fGrayImg + nTop * nImgW + nLeft;
	pucMask = maskMat.data + (nTop + nYShift) * nMaskMatW + (nLeft + nXShift);
	for (int j = nTop; j <= nBottom; j++)
	{
		for (int i = nLeft, n = 0; i <= nRight; i++, n++)
		{
			if (pucMask[n])
			{
				bMax = true;
				fM = pF[n];
				for (int m = 0; m < k - 1; m++)
				{
					if (pF[n + nOffsets[m]] > fM)
					{
						bMax = false;
						break;
					}
				}

				if (bMax)
				{
					ptVec.push_back(Point(i, j));
				}
			}
		}
		pucMask += nMaskMatW;
		pF += nImgW;
	}
}
