void grapenum(Mat img_gray) {
	Mat FMAt;
	Mat MMAt(img_gray.size(), CV_8UC1, Scalar(0));
	Mat small_img;
	Mat gray_img;
	//resize(img_gray, gray_img, Size(round(img_gray.cols >> 3), round(img_gray.rows >> 3)), INTER_NEAREST);
	gray_img = img_gray.clone();
	vector<Point> maxPtVec0;//
	vector<Point> maxPtVec;
	w_PreProgress(gray_img, FMAt, MMAt);
	Mat temp_fmat = FMAt.clone();
	double maxzhi;
	minMaxLoc(FMAt, 0, &maxzhi, 0, 0);
	int val_max = roundl(maxzhi);
	int nBide = 5/*(val_max >> 2)*/;
	IPA_findLocalMax((float *)FMAt.data, MMAt.cols, nBide, MMAt.cols - nBide - 1, nBide, MMAt.rows - nBide - 1, MMAt, -nBide, -nBide, 3, maxPtVec0);
	int nNearsOffsetTable[6560];
	CalNearsTmpTable(MMAt.cols, nBide, nNearsOffsetTable);
	int nTableIndex = max(0, nBide - 1);
	int m_nTableLen[40];
	for (int nBide = 1; nBide <= 40; nBide++)
	{
		m_nTableLen[nBide - 1] = ((nBide << 1) + 1) * ((nBide << 1) + 1) - 1;
	}
	IPA_findLocalMax_SameOnlyOne((float*)FMAt.data, maxPtVec0, MMAt.cols, MMAt.rows, nBide, MMAt.cols - nBide - 1, nBide, MMAt.rows - nBide - 1, nBide * 2/*nDistThMin*/, nNearsOffsetTable, snNearXShiftTable_All[nTableIndex], snNearYShiftTable_All[nTableIndex], m_nTableLen[nTableIndex], maxPtVec, (float*)temp_fmat.data);
	Mat sub_S_Mat(MMAt.size(), CV_8UC1, Scalar(0));
	float fMaxTmp = FLT_MIN;
	vector<Point> ::iterator se_pPtVec = maxPtVec.begin();
	float *pfOriDtImg = (float *)FMAt.data;
	for (; se_pPtVec != maxPtVec.end(); )
	{
		float fDistTmp = pfOriDtImg[se_pPtVec->y*(MMAt.cols)/*s_nImgW*/ + se_pPtVec->x];
		fMaxTmp = max(fMaxTmp, fDistTmp);
		if (fDistTmp < 3)//   //nDistThMin2
		{
			se_pPtVec = maxPtVec.erase(se_pPtVec);
		}
		else
		{
			se_pPtVec++;
		}
	}
}
